import Vue from 'vue';
import VueRouter from 'vue-router';
import Home from '../views/HomePage.vue';        // Importa la vista de la p치gina de inicio
import Register from '../views/RegisterPage.vue'; // Importa la vista de la p치gina de registro

// Usa VueRouter
Vue.use(VueRouter);

const routes = [
  {
    path: '/',          // Ruta para la pantalla de inicio
    name: 'HomePage',
    component: HomePage
  },
  {
    path: '/register',  // Ruta para la pantalla de registro
    name: 'Register',
    component: Register
  }
];

// Crea una nueva instancia de VueRouter
const router = new VueRouter({
  mode: 'history',      // Usa el modo de historial HTML5 (opcional, puedes cambiarlo a 'hash')
  base: process.env.BASE_URL,
  routes                // Define las rutas
});

export default router;  // Exporta el router para que pueda ser usado en main.js
